export default async function createCertificate(
  courseName: string,
  name: string,
  reportRef: any,
) {
  if (!courseName) throw new Error("no course name");

  let template = defaultTemplate;
  template = template.replace("_name_", name);
  template = template.replace("_course_", courseName);
  const reportEl = reportRef.current;

  // Make the div temporarily visible off-screen
  reportEl.style.position = "absolute";
  reportEl.style.left = "-9999px";
  reportEl.style.top = "0";
  reportEl.style.display = "block";

  // A4 LANDSCAPE @ 300 DPI
  const canvasWidth = 2480; // px
  const canvasHeight = 1748; // px

  reportEl.style.width = `${canvasWidth}px`;
  reportEl.style.height = `${canvasHeight}px`; //  FIXED
  reportEl.style.boxSizing = "border-box";

  reportEl.innerHTML = template;

  // Force layout calculation
  reportEl.getBoundingClientRect();
  await new Promise((resolve) => setTimeout(resolve, 300));

  // Capture using html2canvas
  const canvas = await html2canvas(reportEl, {
    scale: 1, //  correct
    backgroundColor: "#ffffff",
    useCORS: true,
    logging: false,
    onclone: (doc) => {
      const root = doc.querySelector("[data-report-root]") as HTMLElement;
      if (!root) return;

      root.style.backgroundColor = "#ffffff";
      root.style.color = "#1a202c";

      root.querySelectorAll("*").forEach((el) => {
        const element = el as HTMLElement;
        const computed = getComputedStyle(element);

        if (computed.color.includes("lab")) element.style.color = "#1a202c";

        if (computed.backgroundColor.includes("lab"))
          element.style.backgroundColor = "#ffffff";
      });
    },
  });

  // Hide the div again
  reportEl.style.display = "none";

  // ---- PDF GENERATION ----
  const pdf = new jsPDF("landscape", "mm", "a4");

  const pdfWidth = 297;
  const pdfHeight = 210;

  // Scale proportionally
  let imgWidth = pdfWidth;
  let imgHeight = (canvas.height * pdfWidth) / canvas.width;

  // Clamp height if needed
  if (imgHeight > pdfHeight) {
    const scale = pdfHeight / imgHeight;
    imgWidth *= scale;
    imgHeight = pdfHeight;
  }

  // Convert once
  const imgData = canvas.toDataURL("image/png");

  pdf.addImage(imgData, "PNG", 0, 0, imgWidth * 2.1, imgHeight * 2);
  pdf.save(`${name}-Bitwise-Learn-Certification.pdf`);
}
